import classes from './Button.module.css'

export default function Button({ onClick, value, butType }) {

   let butClass

   if (butType === 'sign') butClass = classes.sign
   if (butType === 'num') butClass = classes.num

   return (
      <button value={value} onClick={onClick} className={[classes.button, butClass].join(' ')}>
         {value}
      </button>
   )
}
